export function listPlaylists(playlists) {
	return {
		type: 'LIST_PLAYLISTS',
		playlists: playlists
	};
}

export function searchPlaylists(playlists, search) {
	return {
		type: 'SEARCH_PLAYLISTS',
		playlists: playlists,
		searchContent: search
	};
}

export function filterPlaylists(playlists) {
	return {
		type: 'FILTER_PLAYLISTS',
		playlists: playlists
	};
}
